import React from 'react'
import { Form, Input, Button, Checkbox } from 'antd';

export const LoginForm = () => {
  return (
    <div>
        <Form>
        <Form.Item
        label="Username"
        name="username"
        rules={[
          {
            required: true,
            message: 'Please input your username!',
          },
        ]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Password"
        name="password"
        rules={[
          {
            required: true,
            message: 'Please input your password!',
          },
        ]}
      >
        <Input.Password />
      </Form.Item>
        </Form>
    </div>
  )
}
